function Home() {
  return (
    <div className="home-container">
      <h1>Welcome to My Portfolio</h1>
      <p>Aspiring developer with a passion for building user-friendly applications.</p>
      <p>Scroll or use the menu to explore my resume.</p>
    </div>
  );
}

export default Home;
